@prefix : <http://www.semanticweb.org/ontologies/accessControl#> .
@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:User a owl:Class .

:Role a owl:Class ;
     rdfs:subClassOf :User .

:AccessType a owl:Class ;
     rdfs:subClassOf :Role .

:User rdfs:subClassOf [
     a owl:Restriction ;
     owl:onProperty :hasRole ;
     owl:allValuesFrom :Role
] .

:hasRole a owl:ObjectProperty ;
     rdfs:domain :User ;
     rdfs:range :Role .

:RBACSystem a owl:Class ;
     rdfs:subClassOf :System .

:accessControl a owl:ObjectProperty ;
     rdfs:domain :RBACSystem ;
     rdfs:range :AccessType .

:RBACSystem rdfs:subClassOf [
     a owl:Restriction ;
     owl:onProperty :accessControl ;
     owl:allValuesFrom :AccessType
] .
